É preciso dar tempo para o atual, isso é fato. Já o anterior, bom, poderia ser qualquer um, qdo o  dinheiro  fala, os bolsos tremem. Alem do q, para demitir a reciproca ocorre, ñ tem essa de amor ao clube, é apenas uma relação comercial. 
Agora, se ele cair na Copa do Brasil, sei ñ  mas, sei lá  ....
